import React from 'react';

const TransactionList = () => {
    return (
        <div>
            <h3>History</h3>
            <ul id='list' className='list'>
                <li className='minus'> Cash 
                    <span>-$40.00</span><button className='delete-btn'>&times;</button>
                </li>
            </ul>
        </div>
    )
}

export default TransactionList;
